import Head from "next/head";
const HeadTag = () => (
  <>
    <Head>
      <meta name="viewport" content="width=device-width, initial-scale=1" />
      <meta name="keywords" content="Rutakeh, 龍武株式会社, Rutakeh Limited, 龍武, リュウタケ, りゅうたけ, IT研修, プログラミング, 海外留学"></meta>
      <meta name="description" content="IT業界向け各種トレーニング、新入社員教育、e-learning、海外留学、語学研修など、ご相談ください"></meta>
      <meta name="author" content="Rutakeh Limited"></meta>
      <title>龍武株式会社</title>
    </Head>
  </>
);
export default HeadTag;
